svg.script:

      function cc(evt) {
        var circle = evt.target;
        var theID = circle.getAttribute("class").replace(/id_/,'');
	window.open("https://twitter.com/"+theID,"_blank")
        }
      function dd(evt) {
        var circle = evt.target;
        var theID = circle.getAttribute("class").replace(/id_/,'');
        document.querySelector('image.id_'+theID).style.visibility='visible'
        }
      function dd2(evt) {
        var span = evt.target;
        var theID = span.textContent
        document.querySelector('image.id_'+theID).style.visibility='visible'
        }
      function dd3(evt) {
	var tid=evt.target.textContent
        document.querySelector('image.id_'+tid).style.visibility='visible'
	setTimeout(dd3Aux,4000,tid)
        }
      function dd3Aux(tid) {
        document.querySelector('image.id_'+tid).style.visibility='hidden'
        }
      function ee(evt) {
        var circle = evt.target;
        var theID = circle.getAttribute("class").replace(/id_/,'');
        document.querySelector('image.id_'+theID).style.visibility='hidden'
        }

var elements = Array.from(document.querySelectorAll('svg circle'));

// add event listeners
elements.forEach(function(el) {
   el.addEventListener("click", cc);
   el.addEventListener("mouseenter",  dd);
   el.addEventListener("mouseleave",  ee);
})
